import React from 'react';
import styled from 'styled-components';
import Nav from '../Nav/Nav';

let Landing = styled.div`
    color: white;

`

const Home = () => {
    return (
        <div>
            <Nav/>
            <Landing>
                Hue Stage
            </Landing>
        </div>
    );
};

export default Home;
